import React from "react";
import Sidebar from "./Elements/Sidebar";
import Navbar from "./Elements/Navbar";

function App() {
	return (
		<>
			<body>
				<Navbar></Navbar>
				<Sidebar></Sidebar>
				<Main></Main>
			</body>
		</>
	);
}

export default App;
